import React from "react";
import { Container, Row, Col, Button } from "reactstrap";
import { Link } from "react-router-dom";
import "../styles/ThankYou.css";

const ThankYou = () => {
  return (
    <section>
      <Container>
        <Row>
          <Col lg="12">
            <div className="thank__you"></div>
          </Col>
        </Row>
      </Container>
    </section>
  );
};

export default ThankYou;
